import React from 'react';
import products from '../data/products.json'


function Products() {
  console.log((products[0].imgUrl)==='../img/products/new-arrivals/Four_Design_TOHAKU_Candle_Group-1_600x.jpg')
  return (
    <>
    <img src={require(products[0].imgUrl)} alt="" />
    <div>{(products[0].imgUrl)}</div>
    </>

  );
}

export default Products;
